import React from 'react';
import "./header.style.scss";

const Header = ({ msg, firstName, lastName, logo }) => {
    return ( 
        <header className="header">
            <p className="header__name">{`${firstName} ${lastName},`}</p>
        </header>
     );
}
 
export default Header;
